webpackJsonp([0x8df6d7dd2e93],{5248:function(e,t){e.exports={data:{post:{html:"<p>As you might have guessed, the idyll on the patio last evening didn't last very long. </p>\n<p>Today, we sent Grandma and Grandpa on their merry way back to Minnesota. Tomorrow, Mama returns (for a couple of days), Christopher goes back to day care, and I go back after two weeks to a refreshing day at the office.</p>\n<p>Having left my parents early and moved far away, our infrequent but long visits tend to leave me with mixed feelings (there is nothing like your parents to make you feel childish). But Christopher is now something additional that we have in common.</p>\n<p>Well, what you know, my employer made a profit last quarter. A whole Euro 15000. I guess that's what our CEO meant when she was hoping for a 'black zero' for the quarter.</p>",fields:{title:"Sunset Clause",date:"07 May 2001",url:"https://papascott.de/2001-05-07-sunset-clause/"}}},pathContext:{slug:"/2001-05-07-sunset-clause/",prev:{fields:{title:"Patio Life",date:"06 May 2001",slug:"/2001-05-06-patio-life/"}},next:{fields:{title:"Daredevil",date:"08 May 2001",slug:"/2001-05-08-daredevil/"}}}}}});
